package com.yskj.service;import com.yskj.dao.InsPersonDao;import com.yskj.models.InsPerson;import com.yskj.models.PageParam;import com.yskj.models.excel.InsTest;import com.yskj.models.excel.InsTest1;import com.yskj.service.base.AbstractService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import java.util.List;@Servicepublic class InsPersonService extends AbstractService {	@Autowired    private InsPersonDao insPersonDao;	public InsPersonService() {		super();	}	@Override	public InsPersonDao getDao() {		return this.insPersonDao;	}	public List<InsPerson> loadAllUserInsured(PageParam pageParam){		return getDao().loadAllUserInsured(pageParam);	}	public List<InsTest1> findAllInsPersonOfRecord(String recordID){		return getDao().findAllInsPersonOfRecord(recordID);	}}